import React from "react";

function MyProjects() {
  return (
    <div className='myprojects-container'>
      <h2>My proyects</h2>
      <div className='folders-container'>
        <button>
          <FontAwesomeIcon icon="fa-solid fa-folder" />
          FreeCodeCamp</button>
      </div>
    </div>
  )
}

export default MyProjects;
